import React from "react"
import '../App.css';


function HEAD() {
  return (

    <div className="HEAD">
     
      <div className="main">Поиск информации по компаниям 
      <span className="example-1">
        <div className="form-group">
          <label className="label">
            <i className="material-icons">attach_file
            <div className="title">Добавить файл</div>
            </i>
            <input type="file" />
          </label>
        </div>
      </span>
      </div>


      
    </div>


  );
}

export default HEAD;
